import React, { Component } from 'react';

class CourseList extends Component {

    render() { 

        return(
            <ul>
             {
                 this.props.courses.map((course,index)=>{
                    return(
                        <div>
                             <li key={index}>{course.name}</li>
                            <button>Delete Course</button>
                        </div>

                    );
                 })
             }
             <button>Delete Course</button>
            </ul>
        )
    }
}

export default CourseList;
